<!DOCTYPE html>
<html lang="ja">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>O-ring fly | PRTS Terminal v4.0</title>
    <style>
        :root {
            --ak-yellow: #ffd700;
            --ak-yellow-dim: rgba(255, 215, 0, 0.2);
            --ak-bg: #050505;
            --ak-text: #ffffff;
            --ak-text-dim: #666;
            --ak-cyan: #00e5ff;
        }

        * { box-sizing: border-box; }
        body, html {
            margin: 0; padding: 0;
            background-color: var(--ak-bg);
            color: var(--ak-text);
            font-family: 'Inter', sans-serif;
            overflow-x: hidden;
            height: 100%;
        }

        /* --- BACKGROUND LAYERS --- */
        #bg-canvas {
            position: fixed;
            top: 0; left: 0;
            width: 100%; height: 100%;
            z-index: 1;
            filter: blur(1px);
        }

        .overlay {
            position: fixed;
            top: 0; left: 0;
            width: 100%; height: 100%;
            pointer-events: none;
            z-index: 2;
            background: radial-gradient(circle at center, transparent 0%, rgba(0,0,0,0.6) 100%);
        }

        .scanline {
            position: fixed;
            top: 0; left: 0;
            width: 100%; height: 100px;
            background: linear-gradient(to bottom, transparent, var(--ak-yellow-dim), transparent);
            opacity: 0.15;
            z-index: 3;
            pointer-events: none;
            animation: scan 12s linear infinite;
        }

        @keyframes scan {
            from { transform: translateY(-100%); }
            to { transform: translateY(100vh); }
        }

        /* --- CHARACTER SPLASH --- */
        .splash-image {
            position: fixed;
            z-index: 5;
            pointer-events: none;
            transition: all 0.5s ease;
            filter: grayscale(0.5) contrast(1.1);
            opacity: 0.3;
        }

        /* Mobile Splash */
        @media (max-width: 767px) {
            .splash-image {
                left: 50%; top: 50%;
                transform: translate(-50%, -50%);
                height: 80vh;
                width: auto;
            }
        }

        /* Desktop Splash */
        @media (min-width: 768px) {
            .splash-image {
                right: -5%; top: 50%;
                transform: translateY(-50%);
                height: 95vh;
                width: auto;
                opacity: 0.5;
            }
        }

        /* --- CONTENT LAYER --- */
        .layer-middle {
            position: relative;
            z-index: 20;
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            padding: 20px;
        }

        @media (min-width: 768px) {
            .layer-middle {
                flex-direction: row;
                justify-content: flex-start;
                padding-left: 10%;
            }
        }

        .content-panel {
            width: 100%;
            max-width: 450px;
            padding: 40px;
            border-left: 3px solid var(--ak-yellow);
            background: rgba(0, 0, 0, 0.8);
            backdrop-filter: blur(15px);
            clip-path: polygon(0 0, 100% 0, 100% 92%, 92% 100%, 0 100%);
            box-shadow: 0 0 30px rgba(0,0,0,0.5);
        }

        .title {
            font-size: clamp(2.5rem, 8vw, 4rem);
            font-weight: 900;
            margin: 0;
            text-transform: uppercase;
            letter-spacing: -2px;
            line-height: 0.85;
        }

        .data-label {
            font-family: monospace;
            font-size: 10px;
            color: var(--ak-yellow);
            letter-spacing: 2px;
            margin-bottom: 8px;
        }

        .c-cutter {
            background: var(--ak-yellow);
            color: black;
            padding: 4px 12px;
            display: inline-block;
            font-weight: 900;
            font-size: 12px;
            margin-top: 15px;
            clip-path: polygon(0 0, 100% 0, 100% 70%, 85% 100%, 0 100%);
        }

        /* --- HUD ELEMENTS --- */
        .hud-ui {
            position: fixed;
            top: 0; left: 0;
            width: 100%; height: 100%;
            z-index: 100;
            pointer-events: none;
        }

        .corner {
            position: absolute;
            width: 40px; height: 40px;
            border: 1px solid var(--ak-text-dim);
        }
        @media (min-width: 768px) {
            .corner { width: 80px; height: 80px; }
        }
        .tl { top: 15px; left: 15px; border-right: 0; border-bottom: 0; }
        .br { bottom: 15px; right: 15px; border-left: 0; border-top: 0; }

        .system-info {
            position: absolute;
            top: 20px; right: 20px;
            text-align: right;
            font-family: monospace;
            font-size: 9px;
            color: var(--ak-cyan);
            line-height: 1.4;
        }

        .nav-menu {
            position: absolute;
            bottom: 40px; left: 40px;
            display: flex;
            flex-direction: column;
            gap: 12px;
            pointer-events: auto;
        }

        .nav-item {
            font-weight: 900;
            font-size: 1rem;
            text-transform: uppercase;
            letter-spacing: 2px;
            cursor: pointer;
            transition: all 0.2s;
            display: flex;
            align-items: center;
            color: var(--ak-text-dim);
        }
        .nav-item:hover {
            color: var(--ak-yellow);
            padding-left: 10px;
        }
        .nav-item::before {
            content: "";
            width: 0; height: 2px;
            background: var(--ak-yellow);
            margin-right: 0;
            transition: all 0.2s;
        }
        .nav-item:hover::before {
            width: 20px;
            margin-right: 10px;
        }
    </style>
</head>

    <script>
        const canvas = document.getElementById('bg-canvas');
        const ctx = canvas.getContext('2d');
        let particles = [];

        function resize() {
            canvas.width = window.innerWidth;
            canvas.height = window.innerHeight;
        }
        window.addEventListener('resize', resize);
        resize();

        class Particle {
            constructor() {
                this.reset();
            }
            reset() {
                this.x = Math.random() * canvas.width;
                this.y = Math.random() * canvas.height;
                this.size = Math.random() * 2 + 0.5;
                this.speedX = (Math.random() - 0.5) * 0.4;
                this.speedY = (Math.random() - 0.5) * 0.4;
                this.alpha = Math.random() * 0.4 + 0.1;
            }
            update() {
                this.x += this.speedX;
                this.y += this.speedY;
                if (this.x < 0 || this.x > canvas.width || this.y < 0 || this.y > canvas.height) {
                    this.reset();
                }
            }
            draw() {
                ctx.fillStyle = `rgba(255, 215, 0, ${this.alpha})`;
                ctx.fillRect(this.x, this.y, this.size, this.size);
            }
        }

        for (let i = 0; i < 100; i++) {
            particles.push(new Particle());
        }

        function drawGrid() {
            ctx.strokeStyle = 'rgba(255, 255, 255, 0.05)';
            ctx.lineWidth = 1;
            const step = 60;
            for (let x = 0; x < canvas.width; x += step) {
                ctx.beginPath();
                ctx.moveTo(x, 0); ctx.lineTo(x, canvas.height); ctx.stroke();
            }
            for (let y = 0; y < canvas.height; y += step) {
                ctx.beginPath();
                ctx.moveTo(0, y); ctx.lineTo(canvas.width, y); ctx.stroke();
            }
        }

        function animate() {
            ctx.clearRect(0, 0, canvas.width, canvas.height);
            drawGrid();
            particles.forEach(p => {
                p.update();
                p.draw();
            });
            requestAnimationFrame(animate);
        }
        animate();
    </script>
